import { Container, Row, Col } from "react-bootstrap";
import React from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import Select from "@material-ui/core/Select";
import MenuItem from "@material-ui/core/MenuItem";
import FormControl from "@material-ui/core/FormControl";
import InputLabel from "@material-ui/core/InputLabel";
import CommonRow from "../../components/CommonRow";
import "../../CSS/imager_settings.css";
// import { ReactComponent as DroneDiagram } from "../../assets/Drone-Diagram.svg";

function Imager_Settings() {
  return (
    <Container fluid>
      <div>
        <CommonRow />
      </div>
      <Row>
        <Col xs={12} sm={12} md={12} lg={12} xl={12} xxl={12}>
          <div className="mainDiv">
            <div className="buttonContainer">
              <div className="toggleType">Toggle Image Type</div>
              <button className="button buttonFielddock">
                FieldDock Imager
              </button>
              <button className="button buttonMosaicked">
                Mosaicked Drone Images
              </button>
            </div>
          </div>
        </Col>
        {/* -------------------------------------------------PARENT column row 2 END ----------------------------- */}
      </Row>

      <Row>
        <Col xs={12} sm={12} md={12} lg={12} xl={12} xxl={12}>
          <div className="largeBox">
            <div className="inputContainer">
              <TextField
                id="date"
                label="Date"
                type="date"
                defaultValue="2023-00-00"
                className="dateInput"
                InputLabelProps={{
                  shrink: true,
                }}
              />
              <FormControl className="timeSelect">
                <InputLabel id="time-label">Time</InputLabel>
                <Select labelId="time-label" id="time" defaultValue="00:00PM">
                  <MenuItem value="1:00PM">1:00PM</MenuItem>
                  <MenuItem value="2:00PM">2:00PM</MenuItem>
                  <MenuItem value="3:00PM">3:00PM</MenuItem>
                  <MenuItem value="4:00PM">4:00PM</MenuItem>
                  <MenuItem value="5:00PM">5:00PM</MenuItem>
                </Select>
              </FormControl>
              <Button variant="contained" className="enterButton">
                Enter
              </Button>
            </div>
          </div>
        </Col>
      </Row>
    </Container>
  );
}

export default Imager_Settings;
